let meetings = collections['682c68ce-4e6f-4f1f-a08e-790fe595decc']?.data || [];
if (!Array.isArray(meetings) || meetings.length === 0) {
  alert("لا توجد اجتماعات للتصدير.");
  return;
}

const headers = [
  "عنوان الاجتماع",
  "حالة الاجتماع",
  "اسم العميل",
  "اسم المسئول",
  "الملاحظات",
  "تاريخ الاجتماع"
];

const rows = meetings.map(meeting => {
  const statusName = meeting.meetings_status?.source_name || `ID ${meeting.meetings_status}`;
  const leadName = meeting.leads?.lead_name || `ID ${meeting.leads}`;
  const userName = meeting.profiles?.user_name || `ID ${meeting.user_id}`;

  return [
    meeting.name || "",
    statusName,
    leadName,
	userName,
	meeting.notes || "",
    meeting.date || ""
  ];
});

const csvContent = [
  headers.join(","),
  ...rows.map(row => row.map(value => `"${value}"`).join(","))
].join("\n");

const BOM = "\uFEFF";
const blob = new Blob([BOM + csvContent], { type: "text/csv;charset=utf-8;" });
const url = URL.createObjectURL(blob);
const link = document.createElement("a");
link.setAttribute("href", url);
link.setAttribute("download", "meetings_Export.csv");
link.click();

